 weekdaysShort : 'Dom_Seg_Ter_Qua_Qui_Sex_Sáb'.split('_'),
 weekdaysMin : 'Dom_2ª_3ª_4ª_5ª_6ª_Sáb'.split('_'),
 longDateFormat : {
 LT : 'HH:mm',
 LTS : 'HH:mm:ss',
 L : 'DD/MM/YYYY',
 LL : 'D [de] MMMM [de] YYYY',
 LLL : 'D [de] MMMM [de] YYYY HH:mm',
 LLLL : 'dddd, D [de] MMMM [de] YYYY HH:mm'
 },
 calendar : {
 sameDay: '[Hoje às] LT',
