 h : 'uma hora',
 hh : '%d horas',
 d : 'um dia',
 dd : '%d dias',
 M : 'um mês',
 MM : '%d meses',
 y : 'um ano',
 yy : '%d anos'
 },
 ordinalParse: /\d{1,2}º/,
 ordinal : '%dº',
 week : {
 dow : 1, // Monday is the first day of the week.
 doy : 4 // The week that contains Jan 4th is the first week of the year.
 }
 });

 return pt;

 }));
